import React from 'react';
import Login from './components/login';
import InvoiceList from './components/invoice_list';
import TriggerAutomation from './components/trigger_automation';

const App = () => {
    return (
        <div>
            <h1>Invoice Management System</h1>
            <Login />
            <InvoiceList />
            <TriggerAutomation />
        </div>
    );
};

export default App;
